class Output {
	public static void toScreen(string c, string u) 
	{
		Console.WriteLine("Compressed: " + c + " (length: " + c.Length + ")");
		Console.WriteLine("Uncompressed: " + u + " (length: " + u.Length + ")");
	}

	public static void toFile(string cString, string fileName)
	{
		string js = "var strCompressed = '" + cString + "';";
		File.WriteAllText(fileName, js);
	}
}